import React from 'react';
import styled from 'styled-components';

const Main = () => {
    return (
        <main>
            <h1>Page Title</h1>
            <h2>Subtitle</h2>
            <h3>Sub Sub Title</h3>
        </main>
    );
}

export default Main;

const MainStyled = styled.main`
    h1 {
        background-color: orange;
        font-size; 75px;
    }
`;
